import React from 'react'
import Post from '../containers/PostContainer'
import data from '../data'



class Feed extends React.Component {
  render() {
    return (
      <div className='feed'>
        {data.map(post => <Post name={post.name}/>)}
      </div>
    )
  }
}


export default Feed
